pub fn get_sparksql_root_grammar_id() -> GrammarId {
    GrammarId(1850)
}
pub fn get_sparksql_root_grammar_table() -> RootGrammar {
    RootGrammar::TableDriven {
        grammar_id: get_sparksql_root_grammar_id(),
        tables: &SPARKSQL_TABLES,
    }
}
pub fn get_sparksql_root_grammar() -> RootGrammar {
    get_sparksql_root_grammar_table()
}
